import React from 'react'
import { AppContext } from '../App';
import { useContext } from 'react';
import { useNavigate } from "react-router-dom";


function Babysitters() {
    const {city, data} = useContext(AppContext)
    const navigate = useNavigate();
    
  return (
    <div> Here is available Babysitters list for: {city}
    
    Available: {data.baby.map((i) => (
            <div className='content'>
              <div className='age'> {i.age}</div>
              <div className='gender'> {i.gender}</div>
              <div className='months'> {i.months}</div>
            </div>
          ))}
    </div>
  )
}

export default Babysitters
